import React from 'react';
import './severity.scss';


class Severity extends React.Component {
  render() {
    return (
      <div>
        <div class="severity">
          <div className="square-level3"></div>
          <div className="square-level1"></div>
          <div className="square-level2"></div>
          <div className="square-level4"></div>
        </div>
      </div>
    );
  }
}

export default Severity;
